column15:
Amadou DIAWARA, 37 ans. De nationalité Franco-Malienne, Il a grandi entre le Mali et la France ou il y étudie
les métiers de l’Informatique et du Commerce.
Titulaire d’un Baccalauréat en science, il passe alors un BTS en informatique de gestion puis un DESS en
ingénierie des génies logiciels au sein de l’IPAG Paris.
S’en suivra un long parcours dans différentes grandes sociétés françaises et internationales (Olivetti, Bull,
HP…).
Marié et père de quatre enfants il Retourne au Mali en 2010 afin de se lancer dans l’ingénierie informatique.
En 2017, il obtient une certification en Blockchain.
Il est aujourd’hui :
- PDG du Groupe FAMIB présent au Mali, en France, au Niger et en Côte d’Ivoire qui emploie plus de
107 personnes.
- Editeur des solutions KINGUI :
- Incubateur en ligne FAMIB Labs ;
- Média KINGUI Actu, Web TV ;
- Agence de communication Digital Créatis ;
- Plateforme de vente en ligne KINGUI Express ;
- Service de SMS Banking Digital Framework ;
- Fourniture et assemblage de mobilier ergonomique FSR Office ;
- Président Fondateur de l’Université Virtuelle du Mali UPP KINGUI ;
- Vice-président du Forum sur la Gouvernance de l’Internet au Mali ;
- CEO de la Société XAALISI SAS, créateur des crypto-monnaies Xaalisi, MaliWari, Eburnie Coin, de la
plateforme d’échange crypto KINGUI Coin et du premier restaurant crypto en Afrique ;
- Experts en E-Gouv et transformation digitale ;
- Consultant Blockchain ;
- Fondateur de KINGUILAND, Centre de Recherche et d’Innovation Technologique ;
- Membre du chapitre malien de ISOC (Internet Society) ;
- Membre du Club des Investisseurs Européens ;
- Membre de ASIM (Association des Sociétés Informatique du Mali ;
- Représentant du Mali au CINVU (COMSTECH Inter-Islamic Network on Virtual University) ;
- Membre du CAUDEV (Consortium Africain Universitaire pour le Développement de l’Enseignement
Virtuel) ;
- Membre de AUNEGe (Association des Universités pour le développement de l’enseignement
numérique en Economie et Gestion) en France, réseau des Universités Numérique Thématique (UNT).
